import "../styles/postCard.css";

function PostCard({ title }) {
  return (
    <div class="popular-posts">
      <div class="card">
        <h3>Post 1</h3>
        <p>Description of Post 1</p>
      </div>
      <div class="card">
        <h3>Post 2</h3>
        <p>Description of Post 2</p>
      </div>
      <div class="card">
        <h3>Post 3</h3>
        <p>Description of Post 3</p>
      </div>
    </div>
  );
}

export default PostCard;
